import React, { useEffect } from 'react';

import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import { useSelector, useDispatch } from 'react-redux';
import { resultListSlice } from '../redux/resultListSlice';
import './resultlist.css'
import { width } from '@mui/system';

function ResultList() {


  let resultsListToggle = useSelector(state => state.app.resultsListToggle);
  let searchResults = useSelector(state => state.result.searchResults)


    return (

        <Drawer
            anchor='left'
            open={resultsListToggle}
            variant="persistent"
            PaperProps={{
                sx: {
                  marginTop:8,
                  width:400,
                }
              }}

        >
            <Box>

            {searchResults.map((value, index) => <div>

                        <div className='resulttext'>{value.name}</div>

                </div>)}

            </Box>
        </Drawer>

    )


}

export default ResultList;

